import React from "react";
import "./signUp.css";
import { Link } from "react-router-dom";

import { useFormik } from "formik";

import * as yup from "yup";
function SignUp() {
  const EmployeeComponent = () => {
    const formik = useFormik({
      initialValues: {
        Email: "",
        Password: "",
        ConformPassword: "",
      },

      validationSchema: yup.object({
        Email: yup
          .string()
          .email("Invalid email address")

          .required("Please Enter Email Id"),

        Password: yup
          .string()
          .max(20, "Name should not exceed 8 Characters")
          .required("Please Enter Password "),

        ConformPassword: yup.string()
        .equals((values)=>{})
      }),

      onSubmit: (values) => {
        alert(JSON.stringify(values));
      },
    });
  };

  return (
    <div className="signup">
      <span className="heading greet">Welcome To </span>
      <span className="h1 heading "> Project Of Guvi Assienment</span>

      <span className=" heading emailtxt">Enter the email</span>

      <input
        className="form__inset"
        typeof="text"
        placeholder="Email"
        name="email"
      />
      <label className=" heading emailtxt">Enter the Password</label>

      <input
        className="form__inset"
        typeof="text"
        placeholder="Password"
        name="email"
      />
      <span className=" heading emailtxt">Enter the Conform Password</span>

      <input
        className="form__inset"
        typeof="text"
        placeholder="Password"
        name="email"
      />
      <button
        onClick={() => {
          console.log("thi is the sign up fun");
        }}
        className="login-butt"
      >
        {" "}
        SignUp
      </button>

      <span className=" heading emailtxt">
        If You Have Already Account Please <Link to={"/login"}> login</Link>
      </span>
    </div>
  );
}

export default SignUp;
